/**
 * A chemical or biologic substance, used as a medical therapy, that has a physiological effect on an organism. Here the term drug is used interchangeably with the term medicine although clinical knowledge makes a clear difference between them.
 * @property {Text | DrugPrescriptionStatus} Indicates the status of drug prescription, e.g. local catalogs classifications or whether the drug is available by prescription or over-the-counter, etc.
 * @property {Text} Any precaution, guidance, contraindication, etc. related to consumption of specific foods while taking this drug.
 * @property {HealthInsurancePlan} The insurance plans that cover this drug.
 * @property {Text} The unit in which the drug is measured, e.g. '5 mg tablet'.
 * @property {Text} Any precaution, guidance, contraindication, etc. related to this drug's use during pregnancy.
 * @property {Text} Proprietary name given to the diet plan, typically by its originator or creator.
 * @property {DoseSchedule} A dosing schedule for the drug for a given population, either observed, recommended, or maximum dose based on the type used.
 * @property {Text} Description of the absorption and elimination of drugs, including their concentration (pharmacokinetics, pK) and biological effects (pharmacodynamics, pD).
 * @property {Text} Any information related to overdose on a drug, including signs or symptoms, treatments, contact information for emergency response.
 * @property {Boolean} True if this item's name is a proprietary/brand name (vs. generic name).
 * @property {Text} Any precaution, guidance, contraindication, etc. related to consumption of alcohol while taking this drug.
 * @property {Text} A route by which this drug may be administered, e.g. 'oral'.
 * @property {URL} Link to prescribing information for the drug.
 * @property {URL | Text} Any FDA or other warnings about the drug (text or URL).
 * @property {Text} An active ingredient, typically chemical compounds and/or biologic substances.
 * @property {Text} The generic name of this drug or supplement.
 * @property {DrugPregnancyCategory} Pregnancy category of this drug.
 * @property {MaximumDoseSchedule} Recommended intake of this supplement for a given population as defined by a specific recommending authority.
 * @property {Text} The RxCUI drug identifier from RXNORM.
 * @property {Drug} Another drug that is known to interact with this drug in a way that impacts the effect of this drug or causes a risk to the patient. Note: disease interactions are typically captured as contraindications.
 * @property {DrugClass} The class of drug this belongs to (e.g., statins).
 * @property {Text} A dosage form in which this drug/supplement is available, e.g. 'tablet', 'suspension', 'injection'.
 * @property {Drug} Any other drug related to this one, for example commonly-prescribed alternatives.
 * @property {DrugStrength} An available dosage strength for the drug.
 * @property {Boolean} True if the drug is available in a generic form (regardless of name).
 * @property {MedicalEnumeration | DrugLegalStatus | Text} The drug or supplement's legal status, including any controlled substance schedules that apply.
 * @property {Text} The specific biochemical interaction through which this drug or supplement produces its pharmacological effect.
 * @property {Text} Description of the absorption and elimination of drugs, including their concentration (pharmacokinetics, pK) and biological effects (pharmacodynamics, pD).
 * @property {Text} Any precaution, guidance, contraindication, etc. related to this drug's use by breastfeeding mothers.
 * @property {URL} Link to the drug's label details.
 */
