  proprietaryName?: Text
  doseSchedule?: DoseSchedule
  clinicalPharmacology?: Text
  overdosage?: Text
  isProprietary?: Boolean
  alcoholWarning?: Text
  administrationRoute?: Text
  prescribingInfo?: URL
  warning?: URL | Text
  activeIngredient?: Text
