/**
 * A media object, such as an image, video, audio, or text object embedded in a web page or a downloadable dataset i.e. DataDownload. Note that a creative work may have many media objects associated with it on the same web page. For example, a page about a single song (MusicRecording) may have a music video (VideoObject), and a high and low bandwidth audio stream (2 AudioObject's).
 * @property {Date | DateTime} Date (including time if available) when this media object was uploaded to this site.
 * @property {Text} The [SHA-2](https://en.wikipedia.org/wiki/SHA-2) SHA256 hash of the content of the item. For example, a zero-length input has value 'e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855'.
 * @property {Text} Player type required&#x2014;for example, Flash or Silverlight.
 * @property {Text} The bitrate of the media object.
 * @property {Text} File size in (mega/kilo)bytes.
 * @property {QuantitativeValue | Distance} The height of the item.
 * @property {CreativeWork} The CreativeWork encoded by this media object.
 * @property {Distance | QuantitativeValue} The width of the item.
 * @property {Time | DateTime} The startTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to start. For actions that span a period of time, when the action was performed. E.g. John wrote a book from *January* to December. For media, including audio and video, it's the time offset of the start of a clip within a larger file.\n\nNote that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.
 * @property {Boolean | MediaSubscription} Indicates if use of the media require a subscription  (either paid or free). Allowed values are ```true``` or ```false``` (note that an earlier version had 'yes', 'no').
 * @property {Duration} The duration of the item (movie, audio recording, event, etc.) in [ISO 8601 date format](http://en.wikipedia.org/wiki/ISO_8601).
 * @property {GeoShape | Place | Text} The ISO 3166-1 (ISO 3166-1 alpha-2) or ISO 3166-2 code, the place, or the GeoShape for the geo-political region(s) for which the offer or delivery charge specification is not valid, e.g. a region where the transaction is not allowed.\n\nSee also [[eligibleRegion]].       
 * @property {URL} A URL pointing to a player for a specific video. In general, this is the information in the ```src``` element of an ```embed``` tag and should not be the same as the content of the ```loc``` tag.
 * @property {Place} The regions where the media is allowed. If not specified, then it's assumed to be allowed everywhere. Specify the countries in [ISO 3166 format](http://en.wikipedia.org/wiki/ISO_3166).
 * @property {Organization} The production company or studio responsible for the item, e.g. series, video game, episode etc.
 * @property {NewsArticle} A NewsArticle associated with the Media Object.
 * @property {Claim} Used to indicate a specific claim contained, implied, translated or refined from the content of a [[MediaObject]] or other [[CreativeWork]]. The interpreting party can be indicated using [[claimInterpreter]].
 * @property {URL} Actual bytes of the media object, for example the image file or video file.
 * @property {Time | DateTime} The endTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to end. For actions that span a period of time, when the action was performed. E.g. John wrote a book from January to *December*. For media, including audio and video, it's the time offset of the end of a clip within a larger file.\n\nNote that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.
 * @property {Text | URL} Media type typically expressed using a MIME format (see [IANA site](http://www.iana.org/assignments/media-types/media-types.xhtml) and [MDN reference](https://developer.mozilla.org/en-US/docs/Web/HTTP/Basics_of_HTTP/MIME_types)), e.g. application/zip for a SoftwareApplication binary, audio/mpeg for .mp3 etc.  In cases where a [[CreativeWork]] has several media type representations, [[encoding]] can be used to indicate each [[MediaObject]] alongside particular [[encodingFormat]] information.  Unregistered or niche encoding and file formats can be indicated instead via the most appropriate URL, e.g. defining Web page or a Wikipedia/Wikidata entry.
 */
export type MediaObject = 'MediaObject' | CreativeWork & Thing & {
  is: 'MediaObject'
uploadDate?: Date | DateTime
  sha256?: Text
  playerType?: Text
  bitrate?: Text
  contentSize?: Text
  height?: QuantitativeValue | Distance
  encodesCreativeWork?: CreativeWork
  width?: Distance | QuantitativeValue
  startTime?: Time | DateTime
  requiresSubscription?: Boolean | MediaSubscription
  duration?: Duration
  ineligibleRegion?: GeoShape | Place | Text
  embedUrl?: URL
  regionsAllowed?: Place
  productionCompany?: Organization
  associatedArticle?: NewsArticle
  interpretedAsClaim?: Claim
  contentUrl?: URL
  endTime?: Time | DateTime
  encodingFormat?: Text | URL
}



