/**
 * A predefined value for a product characteristic, e.g. the power cord plug type 'US' or the garment sizes 'S', 'M', 'L', and 'XL'.
 * @property {QualitativeValue} This ordering relation for qualitative values indicates that the subject is greater than the object.
 * @property {QualitativeValue} This ordering relation for qualitative values indicates that the subject is greater than or equal to the object.
 * @property {QualitativeValue} This ordering relation for qualitative values indicates that the subject is lesser than the object.
 * @property {QualitativeValue} This ordering relation for qualitative values indicates that the subject is lesser than or equal to the object.
 * @property {QualitativeValue} This ordering relation for qualitative values indicates that the subject is equal to the object.
 * @property {PropertyValue} A property-value pair representing an additional characteristic of the entity, e.g. a product feature or another characteristic for which there is no matching property in schema.org.\n\nNote: Publishers should be aware that applications designed to use specific schema.org properties (e.g. https://schema.org/width, https://schema.org/color, https://schema.org/gtin13, ...) will typically expect such data to be provided using those properties, rather than using the generic property/value mechanism. 
 * @property {QuantitativeValue | PropertyValue | StructuredValue | Text | DefinedTerm | Enumeration | QualitativeValue | MeasurementTypeEnumeration} A secondary value that provides additional information on the original value, e.g. a reference temperature or a type of measurement.
 * @property {QualitativeValue} This ordering relation for qualitative values indicates that the subject is not equal to the object.
 */
export type QualitativeValue = 'QualitativeValue' | Enumeration & Intangible & Thing & {
  is: 'QualitativeValue'
greater?: QualitativeValue
  greaterOrEqual?: QualitativeValue
  lesser?: QualitativeValue
  lesserOrEqual?: QualitativeValue
  equal?: QualitativeValue
  additionalProperty?: PropertyValue
  valueReference?: QuantitativeValue | PropertyValue | StructuredValue | Text | DefinedTerm | Enumeration | QualitativeValue | MeasurementTypeEnumeration
  nonEqual?: QualitativeValue
}



